import React from 'react';
import { Link } from 'react-router-dom';
import '../css/inventory.css';
import { Card } from './warehouse-card';

export function Inventory({ data }) {
	const warehouseCards = data.map((warehouse) => {
		console.log(warehouse);
		return <Card warehouse={warehouse} />;
	});

	return (
		<div>
			<Search />
			<div className='container'>{warehouseCards}</div>
		</div>
	);
}

function Search() {
	return (
		<div className='wrapper'>
			<div className='section name'>Inventory</div>
			<div className='section'>
				<form>
					<input
						className='inventory-input'
						placeholder='Search...'
						type='text'
					/>
				</form>
			</div>
		</div>
	);
}
